import { useState } from "react";
import FileBase64 from "react-file-base64";
const CreateBlog = () => {
  const [createPost, setCreatePost] = useState({
    title: "",
    content: "",
    datePublished: "",
    author: "",
    tags: "",
    image: "",
    comments: "",
    likes: 0,
  });

  const setBlogContent = (e) => {
    setCreatePost((prev) => {
      // tags
      // datePublished
      // comments
      // image
      //   const author = e.target.name === "author" ? e.target.value : "";
      switch (e.target.name) {
        case "tags":
          return {
            ...prev,
            [e.target.name]: e.target.value.split(","),
          };

        case "datePublished":
          return {
            ...prev,
            [e.target.name]: e.target.value,
          };
        case "comments":
          return {
            ...prev,
            [e.target.name]: [
              { text: e.target.value, author: prev.author, date: new Date() },
            ],
          };

        case "image":
          console.log(e);

        default:
          return {
            ...prev,
            [e.target.name]: e.target.value,
          };
      }
    });
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(createPost);
  };

  return (
    <>
      <h2>Create Blog</h2>
      <form>
        <p>
          <input
            type="text"
            name="title"
            placeholder="Enter title"
            value={createPost.title}
            onChange={setBlogContent}
          />
        </p>
        <p>
          <textarea
            name="content"
            placeholder="Enter blog description"
            value={createPost.content}
            onChange={setBlogContent}
          ></textarea>
        </p>
        <p>
          <input
            type="text"
            name="author"
            placeholder="Enter author name"
            value={createPost.author}
            onChange={setBlogContent}
          />
        </p>
        <p>
          <input
            type="date"
            name="datePublished"
            // value={createPost.datePublished}
            onChange={setBlogContent}
          />
        </p>
        <p>
          <input
            type="text"
            name="tags"
            placeholder="Enter tags seperated by comma"
            value={createPost.tags}
            onChange={setBlogContent}
          />
        </p>
        <p>
          <FileBase64
            type="file"
            // name="image"
            value={createPost.image}
            onDone={({ base64 }) => {
              console.log(base64);
              setBlogContent((prev) => {
                return {
                  ...prev,
                  image: base64,
                };
              });
            }}
            // onChange={setBlogContent}
          />
        </p>
        <p>
          <input
            type="number"
            name="likes"
            placeholder="Enter any number"
            value={createPost.likes}
            onChange={setBlogContent}
          />
        </p>
        <p>
          <input
            type="text"
            name="comments"
            placeholder="Enter comment"
            // value={createPost.comments}
            onChange={setBlogContent}
          />
        </p>
        <button onClick={handleSubmit}>Create</button> <button>Clear</button>{" "}
        <button>Cancel</button>
      </form>
      <img
        height={100}
        width={100}
        src="data:image/jpeg;base64,"
      />
    </>
  );
};

export default CreateBlog;
